import React from "react";
import styled from "styled-components";
import Board from "./Board/Board";

const StyleBoard = styled.div`
    background-color: white;
    width: 1200px;
    height: 800px;
    margin: auto;
    margin-top: 100px;
`;
const Board1 = () => {
    return (
        <StyleBoard>
            <Board />
        </StyleBoard>
    );
};

export default Board1;
